import React from 'react';


function ArticleCard({articleData}){
    // console.log("article card article", article)
    return(
        <article>
            <header>
                <div>
                    <img src="" alt=""/>
                </div>
                <div>
                    <h2>{articleData.title}</h2>
                    <p>Article Date</p>
                    <p>Blurb</p>
                    <a href="">Read More</a>
                </div>
            </header>
        </article>
    )
}

export default ArticleCard;
